  const vehicles = [...variables['1e289543-70bc-4444-af7b-32aff35e0804']];

  // Update each vehicle with simulated data
  const updatedVehicles = vehicles.map(vehicle => {
    // Clone the vehicle to avoid reference issues
    const updatedVehicle = { ...vehicle };

    // Simulate movement - update location slightly
    if (updatedVehicle.location) {
      updatedVehicle.location = {
        lat: updatedVehicle.location.lat + (Math.random() * 0.001 - 0.0005),
        lng: updatedVehicle.location.lng + (Math.random() * 0.001 - 0.0005)
      };
    }

    // Update speed (if on trip)
    if (updatedVehicle.status === 'On Trip') {
      updatedVehicle.speed = Math.max(0, Math.min(120, updatedVehicle.speed + (Math.random() * 10 - 5)));
      updatedVehicle.tripKms += updatedVehicle.speed / 3600; // Add distance based on speed (km/h to km/s * update interval)
    } else if (updatedVehicle.status === 'Idle') {
      updatedVehicle.speed = Math.max(0, Math.min(5, Math.random() * 5));
    } else {
      updatedVehicle.speed = 0;
    }

    // Update fuel level (decrease slightly if moving)
    if (updatedVehicle.status === 'On Trip' || updatedVehicle.status === 'Idle') {
      updatedVehicle.fuelLevel = Math.max(0, updatedVehicle.fuelLevel - Math.random() * 0.2);
    }

    // Randomly change status (10% chance)
    if (Math.random() < 0.1) {
      const statuses = ['On Trip', 'Parked', 'Idle', 'Stopped'];
      updatedVehicle.status = statuses[Math.floor(Math.random() * statuses.length)];
    }

    // Randomly update tire pressure (5% chance)
    if (Math.random() < 0.05) {
      const tirePositions = ['fl', 'fr', 'bl', 'br'];
      const randomTire = tirePositions[Math.floor(Math.random() * tirePositions.length)];
      updatedVehicle.tires[randomTire] = Math.random() < 0.7 ? 'Normal' : 'Low';
    }

    return updatedVehicle;
  });

  // Update the global variable with new data
  variables['1e289543-70bc-4444-af7b-32aff35e0804'] = updatedVehicles;

